import React from 'react';
import { shallowEqual, useSelector, useDispatch } from 'react-redux';

import './ListBike.css';

import { mockList } from '../../mockList/mockList'
import ListBikeItem from '../ListBikeItem/ListBikeItem';

const ListBike = () => {

    const dispatch = useDispatch();
    const listBike = useSelector(state => state.listBike.list, shallowEqual);

    const element = listBike.map(({id, ...items}) => {
        return (
            <ListBikeItem
                key={id}
                items={items} />
            ) 
    });

    return (
        <div className="listBike">
            <h3 className="font-weight-bold">Available bicycles (3)</h3>
            <div className="listAvailableBicycles">
                {element}
            </div>
        </div>
    );
};

export default ListBike;
